import React from 'react';
import ColletionItem from '../collection-item/collection-item';

const CollectionPreview = ({ title, items }) => (
	<div>
		<h1>{title.toUpperCase()}</h1>
		<div>
			{items
				.filter((idx) => idx < 4)
				.map(({ ...otherCollectionProps }, id) => (
					<ColletionItem {...otherCollectionProps} key={id} />
				))}
		</div>
	</div>
);

export default CollectionPreview;
